(512, 15, 1, 1, 11, 'Kia', 'Optima', 2013, '2,0 L', 274, 89000, 21200, 'AZN', 0, 'Masin super veziyetdedi \n400 manatliq andiroid manitor \n2000 manat disq yeni madel \n1000 manat keramika etdirmisem cizilmamaqcun \nBir sozlə ideal veziyetdedi \nKaropqa mator yaglari deyisib\nİsdenilen yerde yoxlada bilersiz\nHecbir xerc teleb etmir'),
(513, 3, 1, 1, 11, 'BMW', '528', 2015, '2,0 L', 245, 66000, 22500, '$', 0, 'Tecili satilir! Ideal veziyyetdedir! Hech bir xerci yoxdur! Improtexde gullug olunub! Istenilen yerde yoxlatdira bilersiz! Olkede ilk sahibiyem! Bosh belar adamlar narahat elemesin! Yalniz real alicilar yigsin!'),
(514, 1, 1, 1, 11, 'Volkswagen', 'Passat', 2008, '1,8 L', 170, 230000, 11400, 'AZN', 0, 'Mawinin ikinci sahibiyem 2012ci ilden ozumdedi. Ideal veziyetdedir kuzasi bezkraskadi,motor tezeliycen sifirdan yiğilib,sade korobka.kimin ne suali olsa zeng vurun marağlanin'),
(515, 1, 1, 1, 11, 'Chevrolet', 'Cruze', 2015, '1,4 L', 140, 116000, 14800, 'AZN', 0, 'Maşının heç bir problemi yoxdu. Harada istəsəniz yoxlada bilersiniz'),
(516, 12, 2, 2, 12, 'Kia', 'Ceed', 2008, '1,6 L', 116, 207000, 14000, 'AZN', 0, 'masin olkeye yeni gelib.masinin matoru xadavoyu muftasi ela veziyetdedir.masinda qeti udar vurug olmayib.'),
(517, 9, 1, 1, 11, 'Hyundai', 'Elantra', 2015, '1,8 L', 150, 67000, 20500, 'AZN', 0, 'Kireditlede mümkündü ilkin ödeniş 15000 min 12 ay 720 azn \nMaşın idial vezyetdedi hec bir prablemi yoxdu 2 ildi mendedi seliqeli maşındı real alıcı zeng elesin'),
(518, 3, 1, 1, 11, 'Mercedes', 'C 180', 1994, '1,8 L', 122, 578940, 6400, 'AZN', 0, 'Maşının vəziyyəti yaxşıdır.\nYağ yemir,korobka gecikmir,xodovoyu ela,kondis işləyir.\nBütün plomblar yerindədir,təmiz maşındır.\nBaqajın rəngi solub və kapotunda biraz cızıqlar var.\nSalonu səliqəlidir,təkərlər normal,sənədlərdə düzdür.\nHər şeyi yazdım ki artıq sual vermiyəsiniz.\nMaşın almaq istəyən gəlsin baxsın alsın.Telefonda qiymət soruşmayln xaiş edirəm!!!'),
(519, 9, 1, 1, 11, 'Nissan', 'Maxima', 2003, '3,0 L', 200, 25000, 10800, 'AZN', 0, 'Salam!Mawin yaxwi veziyyetdedi.Gundelik surulen mawindi.Ne xerci olsa pulunan cixacam.Udar qeti yoxdu ciziqlara gore Teze lotka kraskadan cixib ve palirofka olunub.Xeyirli olsun!Barter olar 2016ci ilden yuxari Niva ile men terefden pul ve ya 2005-2009cu ile qeder Hundai Grandeur ancaq 3.3 mator.'),
(520, 9, 2, 1, 9, 'Hyundai', 'Santa Fe', 2007, '2,2 L', 175, 165000, 22900, 'AZN', 0, 'AVTOSALON İDEAL CARS 005\n~~~~~~~~~~~~~~~~~~~~~~~~~~\n2007/2008 alis\nSuper ideal vezyetdedir\nCox sveji cox baximli masindir\nBu ilde bele ideal  Santafe tek tuk olar satisda\nMator karopka ideal vezyetdedir\nMator sesiz isleyir,Mator islemesi eladir\nKaropka saz vezyetdedir\nUzerinde ve salonunda kosmetik is yoxdur\nDeri salondur\n7 yerlikdi İli 2007\n2.2 dizel 2 ceken\nVuruq udar yoxdur 3 detalinda kraska var,yungul kosmetik,Qalan detalari bez kraskadir.\nXadavoy ideal vezyetdedir\nElektronikasi ela vezyetdedir\nKondisoner islekdir\nQizdirici islekdir\nDVD manitor\nArxa kamera\nKsenon lampalar\n165 min orginal prabeq\nTəkerleri ve diskleri tezedir ve s\nİstenilen servisde yoxlatdrmaq mumkundur\nHer  hansisa yoxlanis zamani xerc cixarsa avtomobilde salonumuz terefinden qarsilanacax.\n~~~~~~~~~~~~~~~~~~~~~~~~~~~\nKREDİT və ya LİZİNG şərtləri ilə avtomobil almaq istəyənlərin nəzərinə: \n- Salonumuzda istediyiniz avtomobili kreditlə minimum 40-50% ilkin ödəniş etməklə 3 - 36 aya dək əldə edə bilərsiniz. \n- Avtomobil 2 saat erzində rəsmiləşdirilib müştəriyə təhvil verilir. \n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ \nUNVAN:Baki-Sumqayit yolu,Sumqayit seherine catmamis,Sumqayit masin bazari ile uzbe-uz.N TOİL ZAPRAFKAYLA YAN YANA İDEAL CARS 005 \n2 MERTEBELI AVTOSALON suseli'),
(521, 2, 1, 1, 4, 'Opel', 'Vectra', 1996, '1,8 L', 116, 276000, 4400, 'AZN', 0, 'Avtomobil 1.8 avtomatdı. Benzin sərfiyatı çox ekanomdu.\nMotor korofko və perodok super vəziyyətdədi. Karofkda atması yoxdu. Tam vaxtı vaxtında dəyişir. Motor yağ yemir. İstənilən ustada yoxladıra bilərsiz. İç remeni yeni dəyişmişəm. \nTəkərlər yaxşı\nKondisioner var.\nElektron güzgülər. \n4ədəd elektrik şüşə qaldırıcısı. \nBütün funksiyasiyaları işlək vəziyyətdədir.\nİç remeni yeni dəyişmişəm.\nTəcili olaraq satılır.\nNəğd qiyməti 4400azn.\nKredit ilə istəyən olsa 2300azn qabağı\n15ay 250azn.'),
(522, 9, 1, 2, 4, 'Opel', 'Astra', 2004, '1,4 L', 90, 213750, 11300, 'AZN', 0, 'AVTOMOBIL 09.09.2022 tarixinda galib \nILKIN ODANIS 4300 azn + 24 ay 430 azn\nMasin àla vaziyyatdadir!'),
(523, 1, 1, 2, 11, 'Chevrolet', 'Aveo', 2011, '1,2 L', 86, 181500, 11400, 'AZN', 0, 'Masin ideal vəzyətdədi Servisdə qulluğ olunub\nAllah alanada Satanada xeyir versin'),
(524, 1, 1, 1, 9, 'Lexus', 'GX 460', 2012, '4,6 L', 296, 106000, 37800, '$', 0, 'Avtomobil 2013-cü ildə servisdən alınıb və bu günədək servisdə xidmət olunur. Avtomobilin detalında ksok rənglər var. Avtomobilin udarı yoxdur. Çox təmiz və səliqəli sürülüb. Modelin ən full variantıdır. Avtomobilin sahibi özüməm.\nÜnvan: 8-ci mkr.'),
(525, 1, 2, 1, 7, 'Mercedes', 'Sprinter 515', 2014, '3,2 L', 194, 255000, 59000, 'AZN', 0, 'EXSTRA LONG\nQOŞA TEKER\nQOŞA KONDISIONER\nAVTOMAT KAROPKA\n3.2 MOTOR\n20+1 YER YIĞILIB.\n Içerisi Tam ideal yiğilib!!\nmaşin ideal veziyyetdedir.\nTəzə yigilib.azerbaycanda surulmeyib.\nBarter olunmur.\nMotor texpasporta qeyd olunub.\n'),
(526, 5, 2, 2, 8, 'Ford', 'C-Max', 2007, '2,0 L', 136, 218000, 11200, 'AZN', 0, 'Maşın əla vəziyyətdədir.Ustalıq vəziyyətdədir,texniki baxış və sığorta olunub. Kondisaner əla işləyir,ciddi alıcılar narahat etsin. Son qiymətdir,çox təcili satılır.'),
(527, 15, 1, 1, 11, 'Chevrolet', 'Malibu', 2016, '1,5 L', 160, 130000, 22500, 'AZN', 0, 'Full versia ideal veziyetdedir problemi yoxdur. Lizinq yolu ile kredit mumkundur'),
(530, 2, 2, 1, 9, 'Hyundai', 'Santa Fe', 2012, '2,0 L', 184, 75000, 36900, 'AZN', 0, 'Avtomobilə Otoplaza Mall avtomobil şəhərciyində yerləşən CarPro ikinci əl avtomobillərin satış mərkəzində  (Babək pr. Daxili qoşunlar ilə üz-üzə) baxa bilərsiniz. Barter yalnız Hyundai marka avtomobillərlə mümkündü. 25% ilkin ödənişlə kredit şərtləri mövcuddur. İkinci əl avtomobillərin etibarlı satış mərkəzi olan CarPro-ya gəlin, istədiyiniz avtomobili seçin və sərfəli kredit şərtləri ilə əldə edin. Orijinal yürüş məsafəsinə malik avtomobillər, geniş seçim, peşəkar mütəxəssislər, sərfəli şərtlər sizi gözləyir. \nÜstünlüklərimiz:\n	 Auto Azərbaycan zəmanəti;\n	 İlkin ödəniş 25% olmaqla 36 aylıq daxili kredit;\n	 Sürətli rəsmiləşdirmə;\n	 Yüksək keyfiyyətli müştəri xidmətləri;\n	 Geniş seçim imkanları.\n	 Orijinal yürüş məsafəsi\n	 Satış öncəsi peşəkar yoxlanış\n \nBabək pr. 61C, Otoplaza Mall'),
