(533, 9, 1, 1, 11, 'Hyundai', 'Sonata', 2012, '2,4 L', 178, 121000, 19900, 'AZN', 0, 'AVTOSALON IDEAL CARS 005\n~~~~~~~~~~~~~~~~~~~~~~~~\nVTOSALON IDEAL CARS 005 \n~~~~~~~~~~~~~~~~~~~~~~~~~~~ \n2012/2013 alis \nVin kodu eladir. \nTam saz vezyetdedir \nMator karopka saz vezyetdedir \nMator yurusune uygun butun texniki deysiklikler olunub,Tam saz vezyetde. \nXadovoy sistemi saz vezyetdedir \nUdar vuruq qetiyyen yoxdur \nTexniki ve elektronikasi eladir \nButun texniki funksiyalari islekdir \n-LYUK \n-KONDISONER \n-STAR STOP \n-Pult sistemi acarsiz daxil olma el izi ile acilib baglanmasi \n-KEYLOS GO \n-BOYUK MANITOR \n-DERİ SALON \n-OTRACAXLARIN ISIDILMESI \n-On ve arxa otracaxlarda var \n-Ksenon lampalar \n-ACARSİZ DAXİL OLMA ve s \nCox sveji cox baximli masindir \nSalonu kimyevi temizlemeden cixib,Polrofka olunub,Uzerinde ve salonunda hec bir noksan yoxdur. \nSuper gornuslu reng efekti var \nSekilde gorsendiyi kimide realda elede var. \nYurus (propeq)Orginaldi yurus ML NENDİR \nİSTENİLEN SERVİSDE YOXLATDRMAQ MUMKUNDUR \nNE XERCİ CİXARSA SALON TEREFİNDEN ODENİLECEK. \n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ \nKREDİT və ya LİZİNG şərtləri ilə avtomobil almaq istəyənlərin nəzərinə: \n- Salonumuzda istediyiniz avtomobili kreditlə minimum 40-50% ilkin ödəniş etməklə 3 - 36 aya dək əldə edə bilərsiniz. \n- Avtomobil 2 saat erzində rəsmiləşdirilib müştəriyə təhvil verilir. \n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ \nUNVAN:Baki-Sumqayit yolu,Sumqayit seherine catmamis,Sumqayit masin bazari ile uzbe-uz.N TOİL ZAPRAFKAYLA YAN YANA İDEAL CARS 005 \n2 MERTEBELI AVTOSALON suseli'),
