(536, 1, 1, 1, 9, 'Hyundai', 'Santa Fe', 2009, '2,7 L', 185, 227691, 25500, 'AZN', 0, 'Texpasport 2009 7 neferlik 4x4 Tam full\n2.Masin cox ideal vezyetdedir.Hal hazirda xerc teleb etmir.\n3.Mator karobka peredok eladir.\n4.Tekerler teze.Kosmetikaya ehtiyac yoxdur !\n*******************************\nDAXILI KREDIT ve BARTER sertlerimiz var\n----------------------------------------------------\nDAXILI KREDITLE\nIlkin odenis 15000 azn\nmuddet 3 aydan 36 ayadek (musterinin isteyine uygun)\nayliq odenis 539 azn BASLAYARAQ\nKreditin ayliq odenisi verilen ilkin odenisden ve secilmis muddetden asli olaraq deyisir !!!\n*****************************\nMasina BADAMDAR MASIN BAZARININ GIRISINDE ( Yolun qiraginda kohne MIR AVTOSALONUN YERI)\nher gun 9:00-18:00 - dek baxa bilersiniz'),
(537, 14, 1, 1, 11, 'Hyundai', 'Elantra', 2012, '1,8 L', 150, 162000, 19800, 'AZN', 0, 'Servs. Təcili satilir.'),
(538, 6, 1, 1, 4, 'Nissan', 'Tiida', 2012, '1,5 L', 109, 11500, 14300, 'AZN', 0, 'TƏZƏ PARTİYA MAŞINLARIMIZ GƏLDİ. Yaponiyadan Yeni Gəlib. Bakıda sürülməyib. Nissan Tida sedan, Nissan Tida Hecbek, Nissan Note Hər rəng bol ceşid var. BEZ KRASQA. START/STOP. Koja kombrivnı salon. Klimat kondisioner. 6 ədəd SRS. 4 ədəd şüşə qaldıran. Yan güzgülerin qatlnması. Tam saz vəziyyətdədi. Hec bir xərc tələb etmir. Təkərlər təzə. 2011-2012 alış. \nDAXİLİ KTEDİT VƏ LİZİNK MÜMKÜNDÜ. İlkin ödəniş 50 % etməklə. << Ünvan: Sumqayıt şəhəri 17-ci mikrorayon NUR ŞADLIQ evinin yanı BAZAR STORE ilə üzbə-üz >>'),
(539, 1, 3, 1, 11, 'Hyundai', 'Sonata', 2021, '2,0 L', 192, 17500, 29500, '$', 0, 'Hyundai Sonata Hybrid Limited\nHybrid modelinin ən maksimal komplektasiyası\nYanacaq sərfiyyatı 5 litr\nSolar Roof\nDəri oturacaqlar\nOturacaqların qızdırılması və soyudulması\nRulun qızdırılması\nYan pərdələr\nFull LED faralar və stoplar\nColor Heads-up Display\nBOSE premium akustika - audio sistem (böyük monitor)\n360° kamera (Surround View Monitor)\nApple Car Play və Android Auto\nTelefonun simsiz zaradkası\nDistronik\nKor zonaya nəzarət sistemi\nAdaptive Cruise Control\nAuto Hold\nÖn və arxa park radarlar\nXəttə nəzarət sistemi (Line Assist)\nMemory Paket\nAmbient lighting (64 colors)\nvə daha nələr\nMaşın ideal vəziyyətdədir!\nBarter olunmur!\nQiymət yalnız maşının yanında danışılır!\nYalnız real alıcılar zəng etsin!\nVIN: KMHL54JJ1MA032173\n'),
