(545, 9, 1, 1, 11, 'Hyundai', 'Sonata', 2015, '2,0 L', 274, 155000, 26700, 'AZN', 0, 'Masin ideal veziyyetdedir.\nHec bir problemi yoxdur.\nOlkeye yeni gelib, bakida surulmeyib. Insallah kim alarsa bakida ilk sahibi olacaq.\nYeni masindan secilmir.\nAlan adam aparib istediyi yerde yoxlatdira biler.votsap aciqdir. Isdeyen votsaplada yaza biler.\nYurus orijinaldir. Probeqi cekilen masinlarla bir tutmayin.\nMasinda sideni qizdiran, rolda lipicka, arxa goruntu kamerasi, bluetet, mp3, aux, guzgulerde olu zona, telefon, naviqator, star-stop, sport-comfort-normal rejimler ve.s bir cox funksiyalari var. Masin polnu dolu masindir. Limited.\nMasinin ustunde yaxsi nomre var nomre ile birlikde verilecek.\n\nQiymetde razilasma olacaq'),
(546, 9, 1, 1, 9, 'Land Rover', 'RR Sport', 2006, '4,2 L', 390, 240000, 26500, 'AZN', 0, 'Maşında vuruğ udar yoxdur bügünkü gün heç bir xerc tələb etmir maşına ancaq servisdə qulluq olunur sənədlər tam qaydasındadı'),
(547, 1, 2, 1, 11, 'Hyundai', 'Grandeur', 2014, '2,2 L', 202, 112000, 33900, 'AZN', 0, '●\nKOREYADAN GƏLMƏ MAŞINDIR. BURADA SÜRÜLMƏYİB.\n15.000 KM VE YA 12 AY ZEMANET !\n30% ilkin ödəniş etməklə, 36 ayadək MANAT ilə sərfəli daxili kredit! 2 saat ərzində rəsmiləşdirmə ilə avtomobil alıcıya təhvil verilir. Avtomobil ideal vəziyyətdədir hec bir xərc tələb etmir, vuruqsuzdur və heç bir detal dəyişikliyi olunmayıb. Həftənin bütün günləri saat 09:00 dan 18:00-a qədər fəaliyət göstəririk. Əlavə məlumat almaq üçün buyurub OKEAN AVTO salona gələ bilərsiniz.\n__________\n| AVTO-1256 |\n¯¯¯¯¯¯¯¯¯¯'),
