(555, 15, 2, 2, 4, 'Opel', 'Astra', 2006, '1,3 L', 90, 200000, 10500, 'AZN', 0, 'Çox - çox təcili satıram. \nDosta - qardaşa qismət olası maşındır.\n1.3 turbo dizel\n7 skorost\nSepli motor\n\nLizingdədir KREDİT\n9 AY 490 manat ödənişi qalıb.\nGecikməsi var.\n7.500 qabağına istəyirəm. \nNağd bağlansa aşağı olacaq. \nÖz həvəsim üçün yığdırmışam. \n\nBarter ancaq üstündə pul vermək şərti ilə sovet maşınları 07-ə üstünlük verirəm.'),
