(699, 5, 2, 1, 8, 'Kia', 'Carens', 2007, '2,0 L', 140, 197800, 16000, 'AZN', 0, 'Cox tecili.\nAlmandan ozum getizdirmisem gelende orjinal 171000 yurusle gelib bir neçə yerdə yoxlatdırmışam orjinaldı.\n5 yerlikdi. Yük hissəsi cox böyükdü.\nHec bir problemi yoxdu.\nCoxda ekonom maşındı 100 km trasda 5,5-6 lt şəhər içi 8-8,5 lt yanacaq işlədir.\nNeise problemi cixibsa orjinl ve tezesi ile evez olunub.\nIse eve surulub takside surulmeyib.\nCox xahis edirem alverciler zeng etməsin.\nYaq 5000 den bir 5W30 la deyisib.\nKarobqanin yaqin,filtirin və motorun ic remeni ve yazmadığım bir cox ehtiyat hissələri orjinalı ilə əvəz olunub. Lazimi qulluqlari teze olunub.\nKondisioner işləyir.\nBaxanda goreceksiniz baximli masindi.\nMaşınıma cavabdehəm.\nNə problemi çıxsa düzəltdirib verəcəm amma heç bir problemi yoxdu.\nKreditə salmağa köməklik edə bilərəm 6000 azn ilkin ödəniş olsa.\nSatma səbəbim şəxsi nəzərdə tutmadığım problemin çıxmasıdır.'),
