(731, 1, 1, 1, 11, 'Hyundai', 'Sonata', 2008, '2,0 L', 165, 129200, 19599, 'AZN', 0, 'HYUNDAI SONATA N20 model 2008 (zavod kantdi). Koreyadan gəlib, ən maksimal komlektasiya. 2.0 motordu bilən bilir necə dözümlü və qənaətcil olduğunu. Şəxsi avtomobilimdir. Balaca da olsa vuruğu olmayıb, dəyişən detal yoxdur, hal hazırda kosmetik xoşa gəlməyən bir nöqsanı yoxdur.Salon çox səliqəlidir. Təkərləri yaxşıdır. Bütün peredok sıfırdan baxılıb nasaz detalları yenisi ilə əvəz olunub. Motor və korobkası açılmayıb, həmişə Castrol ve Shel 5/40la istifadə olunub. Maşına daimi yaxşı qulluq olunub. ISTƏNILƏN SERVISDƏ YOXLADA BILƏRSINIZ, TAM XƏRCSIZDIR! Avtomobil daim qaraj şəraitində saxlanılır. Yeni avtomobil aldığım üçün İstifadə olunmur. Özünə yaxşı maşın axtaranlar üçün fürsət. Təcili satıldığı üçün qiyməti münasibdir! Allah alana da satana da xeyir versin! Bütün məlumatlar qeyd olunub və şəkilləri ətraflı çəkilib. Artıq dərəcədə xahiş edirəm ucuz yararsız maşın axtaranlar ümumiyyətlə narahat etməsin. Filan yerdə biri var o səndən ucuz verir, Allah min xeyrini versin get al mənim dəyırli vaxtımı alma. '),
