(765, 1, 3, 1, 9, 'Toyota', 'Highlander', 2022, '2,5 L', 249, 0, 58500, '$', 1, '2022 Toyota Highlander Yeni\n\nGrand Limited Edition\n\nSeher serfiyyati 6.5 L\n\nReng ag mirvari\n\nAdaptiv Led on fenerler\nLed duman fenerleri\nDistronik\nGuzgu qizdiricilar\n20 lik yungul lehmli diskler \nZavod istehsali yan padnojka\nElektron qatlanan yan guzguler\nKeyless-go system\nPanoramik lyuk\nSurucuye gore elektron tenzimlenen oturacaq\nQirmizi deri salon 7 neferlik(Red interier)\nSurucuye gore teleskopik tenzimlenen multifunksional sukan\nActive cruise control\nPalasa tanima\nStart/stop/i-stop\n4 zonali clima control kondisioner\n10 inc zavod istehsali touch schreen CARPLAY destekleyini monitor\nEco/ comfort/sport rejimler\nSurusme elehine sistem\nAutoHold\nArxa yan perdeler zavod istehsali\nArxa baqaj knopqa\nArxa goruntu kamerasi\nArxa led fenerler\nArxa park radarlari\n\nBarter yalniz avtomobil ile mumkundur.\n\nUnvan:Rustem Rustemov 26.\nNeon sadliq sarayindan uzu Neftciler metrosu istiqametine gelende Hissa sadliq sarayi ile uzbeuz'),
(766, 9, 1, 1, 11, 'Mercedes', 'C 240', 1998, '2,4 L', 170, 394230, 10800, 'AZN', 0, 'Zavod masindir.kuzada vuruq udar qeti yoxdur.her bir avadanligi islekdi.kondisaneri superdi buz kimi vurur.xadovuyuna 900 man pul xerclemisem.texniki baxis ve sgortasi 15 gundu olunub.16 liq sam disqisi ela veziyetde.salonu cox seliqelidir ,dami oz tentidir.masina sadece kasmetka lazimdir.birde tekerleri zeyifdi.matoru karopkasi cox yaxsi isleyir.masin stoykasi cox duzdu.bir sozle yaxsi masindir.'),
(767, 6, 2, 2, 12, 'Opel', 'Astra', 2006, '2,0 L', 101, 198000, 11300, 'AZN', 0, 'Salam maşın çox ekonom maşındı heçbir prablemi yoxdu harda isdəsəz yoxlatrda bilərsiz mator karopka saz vəzyətdədi maxavik ferodo kamplekt 15 gündü dəyşlib yagda təzə dəyşlib bugünki gündə heçbir prablemi yoxdu '),
