(770, 5, 1, 1, 11, 'BMW', '535', 2015, '3,0 L', 306, 130000, 39700, '$', 0, 'Salam mawinin vurugu yoxdur, mawin arxa bufer ezikle gelib buferden bawqa yerde rengi yoxdur.5 ci seriyanin en full variantidir çolü ici karbondur zavod istehsalidir  Mawinda kor  zona, xett tutma  rejimler ;ecanom confort sport sport + var. Qapilar kart sistem ve (plisos)  baqaj ayaqla acilma faralar dumanilar led ses sistemi harman/kardon ve.s'),
(771, 15, 2, 1, 9, 'Kia', 'Sorento', 2014, '2,0 L', 184, 155000, 38400, 'AZN', 0, 'Ölkəyə yeni gəlib Koreadan 28.07.2022 də.\nÖz maşınımdı.\nHarda istəsəniz yoxlatdıra bilərsiniz.\nQüsur aşkarlanarsa mən tərəfdən qarşılanacaq.\nAutowini Encardan alınmayıb.\n5 yerlik luksuz.\nOturacaq qızdırıcı soyuducu.\nManitor,radar arxa görüntü kamerası.\nKruiz kantrol.\nSükan qızdırıcı.\nElekron oturacaqlar.\nYan pərdələr.\nAuto stop.\nAuto hold.\nHal hazırda hec bir xərc tələb etmir.\nYağları və filteri yeni dəyişilib.\nKuzada pas çürük yoxdu,zərbəsi yoxdur.\nÜmumi kimyəvi təmizlənmə olunub.\nQiymətdə endirim olunacaq.\nBarter olunur ancaq özündən ucuz aftomobillə.\nƏlavə suallar üçün zəng edə bilərsiniz.'),
