(773, 9, 1, 1, 9, 'Toyota', 'Land Cruiser', 2012, '4,0 L', 282, 155000, 38500, '$', 0, 'Avtomobil ideal vezyetdedir.Hec bir problemi yoxdur.Probeq arginaldir.Alici harda istese yoxlada biler.Elave melumat ucun zeng edib maraglana bilersiz. \nMonitor \nKamera \nMulti sukan \nAVt guzguler \nTeze tekerler \nLyuk \nDeri salon \nStart/stop \nSoyuducu \nDvd/cd/phone/bluetooth/aux/usb \nFara yuyan \nPark radarlari \nOturacaqlarin isidilmesi \nClimat control.'),
(774, 6, 1, 1, 11, 'Audi', 'A4', 2003, '1,8 L', 163, 262000, 5000, '$', 0, 'Masin yaxsi vezyettedi.Zeruri olan butun ehtiyat hissseleri deyisilib.Bu gune hec bir xerc teleb etmir.Motor korobkada hec bir nasazliq yoxdu.Xais olunur real  sexsler zenq vursunlar.Istifade omrunu bitirmis Audilernen bir tutmayin.Qiymet baresinde ancaq masinin yaninda.'),
