(780, 15, 1, 1, 11, 'Toyota', 'Avensis', 2010, '2,0 L', 155, 194000, 21300, 'AZN', 0, 'Avtomobil ideal vəziyyətdədir.\nHeçbir xərc tələb etmir.\nTəkərləri yenidir.\nSadəcə ön və arxa bamper müəyyən cızığlara görə rənglənib.\nAvtomobilə vaxtı vaxtında qulluğ olunur.\nAlmaq istəyən şəxs avtomobili istənilən yerdə yoxlatdıra bilər.\nAvtomobil şəkillərdə göründyü kimidir.\nReal alıcıya endirim olunacağ.'),
