(799, 6, 1, 1, 4, 'Volkswagen', 'Golf', 2001, '2,0 L', 115, 163000, 8500, 'AZN', 0, 'Avtomobil 2011-ci ildə Yapon auksiondan 46000 km. yürüşü ilə alınıb (sükan \"rodnoy\" sol tərəflidir), 2.0 mühərrik, Full komplektasiya, Dəri salon, Alpina markalı açılıb-bağlanan monitor və s. \n\nÜstünlüklər:\n- kompakt amma içi çox geniş bir maşındır - şəhər üçün çox əlverişlidir \n- etibarlı avtomobil - 11 il ərzində bir dəfə də məni yolda qoymayıb\n- ekonom bir maşındır - şəhər içi 9-10 litr (92 Aİ), qarışıq rejimdə 7-8 litr\n- komfortlu idman stilində oturacaqlar - keyfiyyətli dəridən hazırlanmış + qış-yay mövsüm üçün bahalı çexollar\n- geniş bagaj yeri\n- yeni təkərlər\n- diaqnostika kabel, yan pərdələr, VW yastıqlar hədiyyə\n\nÇatışmamazlıqlar:\n- dönmə nişan datçiki (датчик поворота) EPS bəzi hallarda səhv göstərirdi ona görə də elektrik onu söndürüb\n- yanacaq datçiki (датчик расхода топлива) dəyişilməlidir, çunki aradan bir səhv məlumat göstərir\n- arxa sağ farada çat var \n\nQEYD: YALNIZ AİLƏ YA DA ŞƏXSİ MAŞIN ÜÇÜN İSTİFADƏ ETMƏK İSTƏYƏNLƏR MÜRACİƏT ETSİN!'),
