(810, 6, 1, 1, 4, 'Chevrolet', 'Cruze', 2016, '1,4 L', 153, 108000, 19500, 'AZN', 0, 'Chevrolet Cruze PREMIER RS :\nŞəxsi avtomobilimdir , ölkəyə 2019-cu ilin Oktyabr ayında gəlib. Full komplektasiyadır. İdeal vəziyyətdədir , heç bir xərc tələb etmir. “Performance Center”-də qulluq olunub (serviz kitabçası mövcüddur). 4 yeni “General Tire – Altimax “ təkərlər\n\nStart Stop\n“BOSE” Audio System\nUzaqdan mühərriki işə salma\nBoyük Monitor\nAndroid Auto & Car Play dəstəkləyir\nSükan, qabaq və arxa oturacaqların qızdırıcısı\n“AutoStop” funksiyası (Hazırda sönük vəziyyətdədir)\n\nBarter olunmur, real alıcıya endirim olunacaq'),
