(853, 9, 1, 1, 9, 'Toyota', 'Land Cruiser', 2021, '3,5 L', 415, 20000, 110000, '$', 0, 'EFFEKTİV İLLİK - 9%İLƏ, HÜQUQİ FƏ FİZİKİ ŞƏXSLƏR ÜÇÜN MANATLA KREDİT VƏ LİZİNQ MÜMKÜNDÜR !!! \n=========================== \nKÖÇÜRMƏ YOLU İLƏ MÜMKÜNDÜR ! \n=========================== \n-TEST DRİVE EDƏ BİLƏRSİNİZ ! \n=========================== \n-5 İl və ya 160.000 km.rəsmi zəmanət! \n=========================== \nDAHA ƏTRAFLI MƏLUMAT AŞAĞIDAKİ GÖSTƏRİLƏN ÜNVANDA ALA BİLƏRSİNİZ! \nÜNVAN - BAKI AVTOMOBİL SATIŞ MƏRKƏZİ (BADAMDAR MAŞIN BAZARI) \nAVTOSALON - TOYOTA BADAMDAR FILIALI \n========================== \nHead up displey \nSport drive - 5 funksiyalı \nMümkün toqquşma ilə bağlı xəbərdarlıq sistemi \nToqquşmadan əvvəl əyləcin işə salınması sistemi \nSərbəst qəza əyləci (AEB) \nAEB-C (şəhər) \nAEB-U (şəhərlərarası) \nHərəkət zolağını dəyişmə ilə bağlı xəbərdarlıq siqnalı (LDA) \nAdaptiv Kruiz Kontrol (Kriuizin sürəti= 0 km/h to 180 km/h) \nUzaq görmə işıqlarının avtomatik işə salınması sistemi \nDifferential lock - torque sensing lsd \nSiqnalizasiya \nABS+BA+EBD+VSC+ATRC+HAC+CRAWL+MTS \nÖn sürücü və sərnişin təhlükəsizlik yastıqları \nYan və pərdə tipli təhlükəsizlik yastıqları \nTəkər təyziqinin göstəricisi \nSərnişinin təhlükəsizlik kəmər xatırladıcısı \navs (tems) \nÖn,müstəqil arxa asqı sistemi: 4-Link \nSükandan idarəetmə sistemi - ad+mid+tel+vo+acc+lda plt \nSükan gücləndiricisi \nMailliyə və çıxışa görə avtomatik tənzimlənən sükan \nAğac işləmələri olan, dəri və qızdırılan sükan \nAvtomatik tənzimlənən ön oturacaqlar \nDəri oturacaqlar \nOturacaqların qızdırılması və soyudulması \nSürücü oturacağının yaddaş paketi \nEasy access system for driver \nAçarsız daxilolma və bir toxunuşla işəsalma \nAntiblik salon güzgüsü \nYağış və işıq sensorları \n4 zonalı avtomatik kondinsioner \nSoyuduculu və qızdırılan konsol qutusu \n1 toxunuşla idarə olunan avtomatik 4 şüşə qaldırıcıları + Pult ilə idarə olunan \nArxa baqajın elektron idarə olunması \nMulti-məlumat displeyi \nWireless ch