(862, 9, 1, 1, 9, 'Toyota', 'Prado', 2013, '4,0 L', 249, 114000, 39700, '$', 0, 'Rəsmi servisdən alınıb, yalnız servisdə qulluq olunub. 7 yerlikdir. Güzgülərin avtomatik qatlanması var.  Heç bir detalna rəng dəyməyib. \nYürüyüşü origiladır. Maşın tam ideal vəziyyətdədir, heç bir xərc tələb etmir, istənilən servisdə yoxlada bilərsiniz. Maşın evropeykadır, xahiş edirəm dubay variantları ilə qiymət müqayisəsi etməyin. '),
(863, 9, 3, 3, 4, 'Toyota', 'Prius', 2010, '1,8 L', 99, 140000, 17900, 'AZN', 0, 'Toyota prius 2010cu il. Azərbaycanda ilk sahibiyəm. \nMaşın full salondur və ideal vəziyyətdədir. Mator, karabka, Abs, batareyalar və sair hissələri tam işləkdir. Probeqi tam orginaldır. Maşın öz adimadir. Qətiyyən taxsiyə surulməyib şəxsi istifadə üçün sürülüb və baxılıb. Maşının alın şüşəsində ki probeq pilka onun karfax məlumatlariyla tam uyğundur. Maşın səhər saat 9.00 dan 18.00 a kimi Mərdəkanda, 18.00 dan sonra Zabratda olur.\nReal müştəri gəlib baxa bilər. \n\nwin kode ( JTDKN3DU9A5187980'),
