(984, 1, 1, 2, 11, 'LADA (VAZ)', '2107', 2007, '1,6 L', 75, 385455, 5550, 'AZN', 0, 'Ili 2006 karbirator barter var hec bir problemi yoxdur'),
(985, 1, 1, 1, 9, 'Land Rover', 'Range Rover', 2013, '5,0 L', 510, 198000, 73000, '$', 0, 'maşın ela veziyyetdedir.\nheç bir problemi yoxdur.\nhazır kreditdedir.\nilk ödeniş 26000$\nbanka 28 ay 3939azn\n'),
(986, 1, 1, 1, 9, 'Cadillac', 'Escalade', 2008, '6,2 L', 388, 91000, 18900, '$', 0, 'Platinium Edition. Tam Full. Arxa 3 Neferlik. Vurug Udar Yoxdu. Yaxwi Veziyyetdedi. \nNomre Verilmir.  Saat 11:00 dan sonra Zeng edin'),
(987, 15, 1, 1, 11, 'BMW', '528', 2013, '2,0 L', 245, 86000, 21500, '$', 0, 'Masin cox idealdi.Hec bir xerc teleb etmir.Real alici istelinen yerde yoxladira biler'),
(988, 9, 1, 1, 9, 'Land Rover', 'Range Rover', 2014, '3,0 L', 340, 149000, 60500, '$', 0, 'BLACK EDITION!\nBEZKRASKA! \nIDEAL VEZIYYETDEDIR!\n- Meridian Səs Sistemi. \n- Səslə idarəetmə. \n- Təkər təzyiqini göstərən sensor. \n- Oturacağın ön tərəfi hündürlüyə görə tənzimlənən. \n- Oturacağın ön tərəfi uzunluğa görə tənzimlənən. \n- 4 zonalı klimat kontrol kondisioner. \n- Avtomatik üzaqgörən işıqları assistenti. \n- Avtomatik qaralan arxa görüntü güzgüsü. \n- Özübərpaedilən Stop/Start sistemi. \n- Ön fənəryuyucuları. \n- Kruiz idarəçilik sistemi. \n- Passiv giriş, Start/Stop sistemi. \n- Siyirməli panoram tavan. \n- Matrix LED ADB+ ön fənərlər. \n- Mebel sükan. \n- Sükan arxasında sürət qutusunun keçirici düymələri. \n- Qızdırılan sükan. \n- Qızdır-an/Soyudu-an ön, qızdır-an arxa oturacaqlar. \n- Ön oturacaqlarda yaddaş paketi. \n- 4 istiqamətdə tənzimlənən bel dəstəyi. \n- Gündüz işıqları. \n- Ön və arxa park sensorları. \n- Arxa kamera. \n- Elektron asqı sistemi. \n- Baqajın elektron açılıb bağlanması. \n- Bluetooth / USB / AUX. \n- Qapi plesosu \n- Soyuducu \nMotor hissəsində km-sı uyğun bütün xərclər çəkilmişdir. \n2013/2014'),
(989, 9, 1, 1, 9, 'Land Rover', 'Range Rover', 2003, '4,4 L', 286, 210000, 22300, 'AZN', 0, 'Maşin Əla vəziyətdədir!!Təzəlikcə 10 min pul qoyulub!Mator karobka peredok ideal vəziyətdədir!!Matoruna 6 AY QARANTİYA veririk!Heç bir Range Rover satan matora qarantiya verməz!Tək Matoru Original detallar ilə yğilib!Daim Bahali yağdan istifadə olunub 2002-2003 de Rəsmi servisdən alinib!ona görə 92 ilə rahat işləyir!Disklərinə 2500 manat verilib!Heç bir çati yoxdur!Originaldir!!2012 modelin original stoplari qoyulub!\nBarter və kredit mümkundur !Fərq etmir  özündən baha və ya ucuz maşin olsun!Münasib qiymətlə barter edərik!\nKredit mümkundur!40 ayadək sərfəli şərtlər ilə kredit etmək olar !İlkin ödəniş 40-50 % olsa yerdə qalanin kredit etmək olar !\nXahiş edirik telefonda barter və kredit şərtlərin soruşmayin !Real fikri olan yaxinlaşa bilər bizim avtosalona və ətrafli barter və kredit şərtlərin maraqlana bilər!  INSERT INTO `cartype` (`id`, `CarTypeName`) VALUES
