(647, 1, 1, 1, 9, 'Toyota', 'Land Cruiser', 2013, '4,0 L', 282, 89000, 43900, '$', 0, 'EVROPEYKA. FULL komplektasiya. Nömre 1 . Avtomobil TOYOTA BAKI mərkəzindən alınıb. Rəng dəyən detalı yoxdur.  Bu günə kimi servizdə baxılıb. Tam əla vəziyyətdədir. Səliqəli və baxılmış avtomobildir. Bütün tələb olunan xərcləri təmin olunubdur. Hal hazırda hec bir xərc tələb etmir. Alıcı istənilən servizdə yoxlatdırıb ala bilər. \n- start / stop, keyles goo (acarsız daxil olma) \n- ponarama lyuk \n- dəri salonu \n- qızdırılan oturacaqlar, \n- oturacaqların elektron tənzimləyicisi, yaddaş oturacaqlar \n- soyuducu \n- klimat kondisioner (iki zonalı) \n- fara yuyanlar \n- yagış və işıq sensoru \n- biksenon , diot faralar \n- parktronik \n- monitor, ön və arxa görüntü kamerası \n- AUX, USB, bluetooth, CD , DVD, mp3, FM radio audio sistemi \n- arxa sərnişin monitoru \n- multi sükan, kruiz kontrol \n- EKO rejim, \n- elektronik güzgi, qatlanan və qızdırıcı \nBütün funksiyalar işləkdir \n---------------------------------------- \nKREDİT və ya LİZİNG şərtləri ilə avtomobil almaq istəyənlərin nəzərinə: \n- Salonumuzda istediyiniz avtomobili kreditlə minimum 40-50% ilkin ödəniş etməklə 3 - 36 aya dək əldə edə bilərsiniz. \n- Yerində sənədləşmə. \n- Avtomobil 2 saat erzində rəsmiləşdirilib müştəriyə təhvil verilir. \n- Kredit şərtləri haqqinda elave məlumat eldə etmək ücün avtosalonumuz ilə əlaqə saxlayın. \n-------------------------------------- \nİstənilən növ avtomobillərin alqı-satqısı, barteri ücün STAR CARS Avto Salonuna müraciət edə bilərsiniz. \nÜnvanımız : Sumqayıt şəh. 17 mk/r , Billur şadlıq evinin yanı, STAR CARS avtosalonu.'),
