(990, 1, 1, 1, 11, 'Mercedes', 'E 350', 2011, '3,5 L', 272, 182500, 20400, '$', 0, 'E350  - sade mator 272 (182km probeq)\n2011 ci il -2014pakete yiqlib (6.3) \nTek arxa cekir .\nPnevmatik deyil ( sade prujin )\nKatalizaotrlari uzerinde . \nSalon seliqelidir yeni madel Rulll . \nSes sistemi Harman/kardon. \nMasinin hec  bir problemi yoxdur Alici istediyi yerde yoxlatdira biler .  hər hansı problem çıxsa qiymətdən iki qatın cıxarsız. \nBarter qiymeti ferqli olacaq .\n'),
(991, 5, 1, 1, 12, 'Mercedes', 'E 240', 1999, '2,4 L', 170, 444444, 11000, 'AZN', 0, 'Ev alışı üçün çox təcili satıram. Hazırda 50 manat xadavoyda xərci var. Bir ay öncə karobkanin yağı qarışıq bütün jitkslari dəyişmişəm. Zaslonka ve farsunka yuyulub, original svecalar ilə 2-3 min km yol sürülüb.\nMaşın bütün günü Yeni Yasamalda məhlədə dayanır. \nUyğun müştəri ilə razılaşacam.'),
(992, 9, 1, 2, 4, 'Kia', 'Rio', 2007, '1,4 L', 97, 211000, 11200, 'AZN', 0, 'Salam Aleykum\nMaşın yeni gəlib\nİdeal vəziyyətdədir\nVuruğ udar yoxdur\nKondisioner buz kimi\nTəkərlər əla\nMotor karobka peredok super\nYürüş orijinal\nSalon ximçista olub\nKredit və Lizinq mümkündür Bank yolu ilə\nİlkin ödəniş 40-45% olmaqla'),
(993, 1, 1, 2, 4, 'LADA (VAZ)', 'Priora', 2013, '1,6 L', 98, 280000, 11700, 'AZN', 0, 'Salam masin oz adimadi pul lazim oldugu ucun satiram masinda andiroid manitor fioletvi patpres deri salon cox seliqeli zovqle yigilib sport purjun ilinin en full versiyasidi baxan bilecey gorunuslu masindi fikri ciddi olan narahat etsin xais edirem '),
(994, 9, 1, 2, 12, 'Opel', 'Astra', 2007, '1,4 L', 90, 185000, 12100, 'AZN', 0, 'Maşın ölkeye yeni  gelib.\nKraskası eladı.   Orginal praberq\nYağış  ve işıq  sensırı var . auto  pilot var.\nUdar ,  çürük , pas qetiyyen yoxdu.\nMator  saat kimi işleyir .kandisaner işleyir.\nFeredo  çaşqa ela.maxavik ela.\nİsteyen lizinq yolu ilede elde ede biler.\nİlkin 4500 azn. \n24 ay   500  azn\n36 ay   390  azn\n'),
(995, 5, 1, 1, 11, 'Chevrolet', 'Cruze', 2018, '1,4 L', 153, 115000, 16800, 'AZN', 0, 'Şəxsi avtomobilimdir. Kankret olaraq heçbir problemi yoxdur. Bütün funksiyaları işləkdir. Yeni kimidir. \n- Kondisioner buz kimi vurur\n- Orjinal zavod katalizator üstündədir\n- Start stop\n- Böyük monitor\n- Elektron sideniya tənzimləyici\n- Şəhər içi sərfiyyat 7 Lt dir. \n- 4 ədəd yeni təkər\n- Multi rull \nNə qulluq lazımdırsa ən yaxşısını etmişem. Probeq orjinal KM ilə qeyd edilib. Gündəlik sürülən maşındır(iş-ev). Yalnız ciddi şəxslər narahat etsin. Boş bekar insanlar narahat etməsin.'),
(996, 1, 1, 1, 11, 'Hyundai', 'Elantra', 2019, '2,0 L', 150, 24300, 36000, 'AZN', 0, '2019 dekabr birka (2020 iyunda Hyundai Auto Azərbaycandan alınıb)\nSadə 2.0 motor, 150 at gücü, Aİ-92 benzini ilə işləyir.\nSadə Avtomat karobka, 6 pilləli\nFull( gündüz led işıqlar, led stoplar, arxa kamera, cruise control, lyuk, klimat kontrol, apple car play, android auto, işıq sensoru, yağış sensoru, 17 lik disklər, arxa ön radar sensorlar və s.)\nServisdə qarantiyadadır\nMotorun Yağı və filtrləri (yağ, hava, kondisioner filtrləri) servisdə yeni dəyişilib(23500 də).\nBezkraska- vuruq və boya yoxdur.\nEkonom maşındır. Şəhər daxili sürüş tərzindən asılı olaraq 7.5-9.5 litr/100km, trass 5.5-7.5 litr/100km benzin sərfiyyatı vardır.\nCüzi endirim olunabilər');

